import React from 'react';
import PropTypes from 'prop-types';

import city from '../../data/city.json';

CityListItem.propTypes = {
  cityList: PropTypes.array,
};

CityListItem.defaultProps = {
  cityList: [],
};

function CityListItem(props) {
  const {cityList} = props;
  return (
    <div>
      <img
        src={require('../../assets/images/city_1.webp')}
        alt=''
        style={{width: '500px', height: '500px'}}
      />
      {city.map((city) => (
        <div key={city.name} className='cityList__item'>
          <img src={require(`../${city.image}`)} alt={city.name} />
          <h1 className='cityList__name'>{city.name}</h1>
          <h2 className='cityList__text'>{city.subText}</h2>
        </div>
      ))}
    </div>
  );
}
export default CityListItem;
